import React from 'react';

const Home = () => {
    return (
        <div style={{ marginTop: '-600px', padding: '50px' }}>

            <h2 style={{ fontSize:'36px', textAlign: 'center'}}>Welcome to Gourmet Guidebook</h2>
            <p style={{ fontSize: '24px', textAlign: 'center'}}>This is the home page of the Recipe Manager application. </p>
            <p style={{ fontSize: '24px', textAlign: 'center' }}>You can use this application to manage your recipes and categories.</p>
            <p style={{ fontSize: '20px', textAlign: 'center'}}>Get started by navigating to the Recipes or Categories page using the navigation links above.</p>
        </div>
    );
};

export default Home;
